var sweetieOhComeOn = {
	soundFileAAC: "data:audio/aac;base64,",
	soundFileOGG: "data:audio/ogg;base64,",
  
	injectAudio: function()
	{
		var sweetieAudioObject = document.createElement("audio");
		sweetieAudioObject.setAttribute("id", "sweetieAudioObject");
		sweetieAudioObject.setAttribute("autoplay", true);

		var sweetieAudioObjectsourceAAC = document.createElement("source");
		sweetieAudioObjectsourceAAC.setAttribute("src", sweetieOhComeOn.soundFileAAC);
		sweetieAudioObjectsourceAAC.setAttribute("type", "audio/aac");

		var sweetieAudioObjectsourceOGG = document.createElement("source");
		sweetieAudioObjectsourceOGG.setAttribute("src", sweetieOhComeOn.soundFileOGG);
		sweetieAudioObjectsourceOGG.setAttribute("type", "audio/ogg");

		sweetieAudioObject.appendChild(sweetieAudioObjectsourceAAC);
		sweetieAudioObject.appendChild(sweetieAudioObjectsourceOGG);

		document.body.appendChild(sweetieAudioObject);
	},
	playAudioFile: function(event)
	{
		if ((event.target && event.target.href && event.target.href.match(/\/(r?(ohcomeon)$)/) != null) || (event.target && event.target.href && event.target.href.match(/\/(r?(a06)$)/) != null))
		{
			event.preventDefault();
			if (!document.getElementById("sweetieAudioObject"))
			{
				sweetieOhComeOn.injectAudio();
			}
			else
			{
				document.getElementById("sweetieAudioObject").play();
			}
		}
	}
};

document.addEventListener("click", sweetieOhComeOn.playAudioFile, false);